import React from "react";
import Nav from "./Nav";
import Footer from "./Footer";

const ProjectDetails = ({ props, title }) => {
  return (
    <div>
      <Nav />
      <h3>{props.title}</h3>

      <Footer />
    </div>
  );
};

export default ProjectDetails;
